                        "Desc": "원소전투 스킬 <color style='color:#FFD780;'>밤무지개 도약</color> 발동 후, 바레사가 「무지개 낙하」를 획득한다. 지속 시간: 5초<br>지속 시간 동안 바레사가 낙하 공격 시, 추락 충격으로 주는 피해가 25% 증가한다. 만약 바레사가 정열 상태인 경우, 추락 충격으로 주는 피해 증가 효과가 50%로 변경된다.<br><br>「무지개 낙하」 효과는 추락 충격이 적에게 명중하거나 지속 시간이 종료되면 사라진다",
