                        "Name": "밤무지개 도약",
                        "Desc": "바레사가 번개처럼 신속하고 맹렬한 보법으로 레슬링의 진수를 뽐내며, 전방으로 일정 거리 돌진해 경로상의 적에게 밤혼 성질의 <color style='color:#FFACFF;'>번개 원소 피해</color>를 준다.<br>발동 후, 바레사가 밤혼을 20pt 획득하고 「연속타」 효과를 얻는다: 지속 시간 동안 바레사의 경직 저항력이 증가하고, 일반 공격을 누르면 바레사가 강공격을 빠르게 진행하며, 해당 강공격은 스태미나를 소모하지 않는다. 「연속타」 효과는 강공격 진행 후 사라진다.<br>짧은 터치와 홀드 시 각각 다른 스타일의 레슬링을 발동한다.<br><br><color style='color:#FFD780;'>짧은 터치</color><br>전방을 향해 빠르게 일정 거리 돌진한다.<br><br><color style='color:#FFD780;'>홀드</color><br>바레사가 밤혼 가호 상태에 진입하고 「맹렬한 돌격」 모드로 전환된다.<br><br><color style='color:#FFD780;'>맹렬한 돌격</color><br>지속적으로 밤혼을 소모한다. 해당 상태에서 바레사의 이동 속도와 경직 저항력이 증가하고, 지형 차이를 이용해 도약하거나, 밤혼을 추가로 소모해 수면과 액체 열소 위에서 이동할 수 있으며, 액체 열소 피해에 면역된다.<br><br><color style='color:#FFD780;'>밤혼 가호 · 바레사</color><br>밤혼 소진 시, 바레사의 밤혼 가호가 종료된다. 바레사가 맹렬한 돌격 모드 또는 열혈 상태 시, 계속 밤혼 가호 상태로 간주된다.<br><br>사용 가능 횟수: 2회. 바레사가 열혈 상태 진입 시, 짧게 눌러 발동하는 원소전투 스킬의 사용 가능 횟수를 추가로 1회 획득하고 원소전투 스킬로 주는 피해가 증가한다.<br><br><color style='color:#FFD780;'>열혈</color><br> · 열혈 상태가 아닐 시, 바레사는 낙하 공격을 통해 밤혼을 회복할 수 있다. 해당 방식으로 밤혼을 최대치까지 회복하거나 원소폭발 <color style='color:#FFD780;'>벼락불 강림!</color> 발동 시, 바레사가 열혈 상태에 진입한다.<br> · 열혈 상태에서 바레사의 일반 공격, 원소전투 스킬, 원소폭발이 각각 강화되고, 낙하 공격 후 짧은 시간 동안 특수한 원소폭발을 발동할 수 있다.<br> · 열혈 상태 최대 지속 시간: 15초. 밤혼 소모 후 혹은 전투 상태 이탈 후 일정 시간이 지나면 상태가 종료된다.<br><br><i>「이제 나는 나의 영웅이 됐어」</i>",
